const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h1>Navbar</h1>
            <ul className="navbar-nav">
                <li className="navbar-item">Home</li>
                <li className="navbar-item">About</li>
                <li className="navbar-item">Login</li>
           </ul>
        </nav>
     );
}
 
export default Navbar;
